import React, { useState } from 'react'
import  ReactDOM  from 'react-dom'
import './index.css'
import image from './robot.png'
let root=ReactDOM.createRoot(document.getElementById('root'));
let mat=[];
let current;
let flag=0;
for(let i=0;i<5;i++){
  let t=[];
  for(let j=0;j<5;j++)
  t.push(' ');
  mat.push(t);
}
let r;
class Page extends React.Component{
  componentDidMount(){
    r=document.getElementById('root');
    flag=1;
  }

  render(){
    return(
      <><Learn/><Grid/><Instruction/><Logicpanel/><Controls/><Play text="play"/><Play text="reset"/></>
    )
  }
}
function Grid(){
  return(
    <div className='Grid'>
    {mat.map((arr,index)=><Row arr={arr} row={index}/>)}
    </div>
  )
}
function Row(props){
return(
  <div className='Row'>
    {props.arr.map((element,index)=><Element val={element} row={props.row} col={index}/>)}
  </div>
)
}
class Element extends React.Component{
  constructor(props)
  {
    super(props)
    this.state={val:this.props.val,flag:0}
  }
  componentDidUpdate(){
    if(this.state.flag!=flag)
    {this.setState({flag:1});alert(1)};
  }
  render(){
    return(
      <div className='Element'> 
        {this.state.val}
        {flag==1 &&
        <img src={image} className="image"></img>}
      </div>
    )
  }
}
function Instruction(){
  return (
    <div className='instruction'>
      <li>instruction</li>
    </div>
  )
}
function Learn(){
return(
  <div className='learn'>

  </div>
)
}
function Panelbutton(){
  const [val,setVal]=useState('');
  return(
    <input draggable onDragOver={(e)=>{e.preventDefault();setVal(current)}} className='panelbutton' value={val}/>
  )
}
function Logicpanel(){
  const items=[];
  for(let i=0;i<15;i++)
  items.push(<Panelbutton/>)
  return(
    <div className='logicpanel' >
      <li>Logicpanel</li>
      {items.map((ele)=>{return ele})}

    </div>
  )
}
function Controls(){
  return(
    <div className='controls'>
      <Controlbutton val='U'/>
      <Controlbutton val='D'/>
      <Controlbutton val='L'/>
     < Controlbutton val='R'/>
    </div>
  )
}
class Controlbutton extends React.Component{
  constructor(props){
    super(props)
    this.state={val:props.val}
    this.handle=this.handle.bind(this);
  }
  handle(){
    current=this.state.val;
  }
  render(){
    return(
      <div className='controlbutton' draggable onDrag={this.handle}>
        {this.state.val}
      </div>
    )
  }
}
function Play(props){

  return(
    <div className='play'>
      {props.text}
    </div>
  )
}
root.render(<Page/>);

setTimeout(()=>{root.render(<Page/>)},3000);
